@import url("https://fonts.googleapis.com/css?family=PT+Mono|Quicksand");
* {
  font-family: 'Quicksand', sans-serif; }

body {
  margin: 0;
  color: #eee;
  overflow: hidden; }

.app-container {
  background: #111;
  width: 100vw;
  height: 100vh;
  display: grid; }

.item {
  background-color: #222;
  border: 1px solid #333; }

.item1 {
  grid-row-start: 1;
  grid-row-end: 2;
  grid-column-start: 1;
  grid-column-end: 10;
  height: 10vh; }

.item2 {
  grid-row-start: 2;
  grid-row-end: 3;
  grid-column-start: 1;
  grid-column-end: 6;
  height: 10vh; }

.item3 {
  grid-row-start: 3;
  grid-row-end: 20;
  grid-column-start: 1;
  grid-column-end: 6;
  height: 80vh;
  width: 60vw;
  overflow-y: auto; }

.item4 {
  grid-row-start: 2;
  grid-row-end: 20;
  grid-column-start: 6;
  grid-column-end: 10;
  width: 40vw; }

/* width */
::-webkit-scrollbar {
  width: 10px; }

/* Track */
::-webkit-scrollbar-track {
  background: #555; }

/* Handle */
::-webkit-scrollbar-thumb {
  background: #888; }

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
  background: #aaa; }
